"1. ఇతర Qi-ఎనేబుల్డ్ వైర్‌లెస్ ఛార్జింగ్ పరికరం (ఉదా. వైర్‌లెస్ ఇయర్‌బడ్స్)ని మీ ఫోన్ క్రింద ఉంచి దానిని మధ్యలోకి అలైన్ చేయండి;
2. వేరే ఏ ఇతర పరికరం కనెక్ట్ చేయబడనట్లయితే, ఫీచర్ స్వయంచాలకంగా ఒక నిమిషంలో ఆఫ్ అవుతుంది;
3. బ్యాటరీ స్థాయి 15%కి తగ్గినప్పుడు కూడా అది స్వయంచాలకంగా ఆఫ్ చేయబడుతుంది."
